import React, { useEffect, useState } from "react";
import ClipLoader from "react-spinners/ClipLoader";
import axios from "axios";

// const override = css`
//   display: block;
//   margin: 0 auto;
//   border-color: red;
// `;

const Home = () => {
  const initSession = JSON.parse(localStorage.getItem("data")) || 0;
  const [dataSession, setDataSession] = useState(initSession);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    console.log(dataSession);
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 8000);
  }, []);

  // const loadings = () => {
  //   setTimeout(() => {
  //     return <ClipLoader color={"#ffff"} loading={loading} size={300} />;
  //   }, 3000);
  //   initSession ? setLoading(false) : setLoading(true);
  // };

  const handleLogout = () => {
    localStorage.clear();
    localStorage.removeItem("data");
  };

  return (
    <>
      {loading ? (
        <ClipLoader color={"#ffff"} loading={"#F37A24"} size={30} />
      ) : (
        <>
          <p>Home</p>

          <form onSubmit={handleLogout}>
            <button className="btn btn-danger">Logout</button>
          </form>
        </>
      )}
    </>
  );
};

export default Home;
